import React from 'react'
import classes from './EnemyHand.css'
import CardFace from '../CardFace/CardFace';

const EnemyHand = props =>(
    <div className={classes.EnemyHand}>
        {
            props.enemyHand.map((index)=>{
                return(
                    <CardFace 
                        key={index}
                    />
                )
            })
        }
    </div>
)

export default EnemyHand
